import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment.prod';
import { User } from '../interfaces/UsersInterfaces';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class UsersListService {
  private path = environment.api;

  constructor(private http: HttpClient) {}

  getUsersList() {
    const url = this.path + '/Users';
    return this.http.get<User[]>(url);
  }

  setUser(userObject: User) {
    const url = this.path + '/Users';
    let myUser = {
      user_id: 3,
      names: 'Prueba',
      last_names: 'Tests',
      email: 'Tests@Tests.co',
      document_number: '111888484',
      username: 'prueba',
      password: 'pruebaTest123',
      born_date: '1999-04-16T04:49:49.959',
      userType_id: 2,
      userTypes: {
        userType_id: 2,
        userType_name: 'string',
        isDeleted: false,
      },
      document_id: 2,
      documents: {
        document_id: 2,
        document_name: 'string',
        isDeleted: false,
      },
      date: '2024-10-21T04:49:49.959',
      modified: '2024-10-21T04:49:49.959',
      modifiedBy: 'swagger',
      isDeleted: false,
    };
    this.http.post(url, myUser).subscribe((rta) => {
      console.log(rta);
    });
  }
}
